  \"2016-11-18T16:40:09.012186\",\n\t\"name\": \"boise-streetlights-open-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This is a point data set representing all
  streetlight locations within Boise Area of Impact, including lights owned by the
  city and by Idaho Power. A streetlight is a light, usually mounted on a pole, and
  constituting one of a series of lights spaced at intervals along a public street
  or highway. This data set was developed by Boise City Public Works Department in
  the early 1990's and is currently maintained by the DIS Division of Boise City Public
  Works under the direction of the Boise City Streetlight Coordinator. This spatial
  data set contains minimal attributes; the majority of the streetlights attributes
  are stored separately in a proprietary non-spatial relational database purchased
  from GBA Master Series. The streetlight point data set contains a foreign key that
  enables the attribute information to be joined to the spatial information. This
  data set is updated continually by Boise City GIS and other staff, and represents
  the current state of streetlights for the Boise City Area of Impact.\",\n\t\"license_title\":
